import React from 'react';
import sdata from './Sdata'

function zcard(val)
{
    console.log(val.title);
    return (
    <>
    <div class="card">
        <img class="card-img-top" src={val.img} alt="Card image cap"/>
    <div class="card-body">
      <h5 class="card-title">{val.title}</h5>
      <p class="card-text">{val.para}</p>
      <a href={val.link} class="btn btn-success">Go somewhere</a>
    </div>
</div>

  </>
    )
}


function MyCard(prop){
   return(
    <>
{sdata.map(zcard)}
    </>
    )  

}

export default MyCard;
